-- DROP DATABASE IF EXISTS metricsdb;
CREATE DATABASE metricsdb CHARACTER SET utf8mb4  COLLATE utf8mb4_bin; 

USE metricsdb;

-- PLEASE RUN  "MYSQLcreateAdminUser.sql"  TO CREATE THE 'ADMIN' USER IF YOU HAVE NOT ALREADY DONE SO.  

-- Note that character set utf8mb4 is the default from MySQL 8.0.
-- The collation for the database is set to utf8mb4_bin
-- This allows for stuff like case-sensitive eventmapping matching.  Also aligns H2 database and Java case sensitive sorting.      


--
-- As noted in the mark59 documentation, ensure GLOBAL variable group_concat_max_len is set to your implementation's maximum value -  
--    however on WINDOWS it appears to simply 'truncate' the value to the maximum allowed for the installation.  Check with
--    SHOW VARIABLES  LIKE 'group_concat_max_len' 
--    on LINUX the SET PERSIST statement may not work, so this file also has:   SET group_concat_max_len = 18446744073709551615;
--

SET group_concat_max_len = 18446744073709551615;           -- works on Linux (tested Mint)  
SET PERSIST group_concat_max_len = 18446744073709551615;   -- works on Win   (see notes above)  

-- create tables  -- 

CREATE TABLE IF NOT EXISTS APPLICATIONS (
  APPLICATION varchar(32) NOT NULL DEFAULT '',
  ACTIVE char(1) DEFAULT NULL,
  COMMENT varchar(256) DEFAULT NULL,
  PRIMARY KEY (APPLICATION),
  UNIQUE KEY APPLICATION (APPLICATION)
); 


CREATE TABLE IF NOT EXISTS EVENTMAPPING (
  TXN_TYPE varchar(64) NOT NULL DEFAULT '',
  METRIC_SOURCE varchar(64) NOT NULL DEFAULT '',
  MATCH_WHEN_LIKE varchar(150) NOT NULL DEFAULT '',
  TARGET_NAME_LB varchar(128) DEFAULT NULL,
  TARGET_NAME_RB varchar(128) DEFAULT NULL,
  IS_PERCENTAGE varchar(1) DEFAULT NULL,
  IS_INVERTED_PERCENTAGE varchar(1) DEFAULT NULL,
  PERFORMANCE_TOOL varchar(45) NOT NULL,
  COMMENT varchar(150) DEFAULT NULL,
  PRIMARY KEY (METRIC_SOURCE,MATCH_WHEN_LIKE,PERFORMANCE_TOOL)
);


CREATE TABLE IF NOT EXISTS GRAPHMAPPING (
  LISTORDER int DEFAULT '0',
  GRAPH varchar(64) NOT NULL DEFAULT '',
  TXN_TYPE varchar(64) DEFAULT NULL,
  VALUE_DERIVATION varchar(2048) DEFAULT NULL,
  UOM_DESCRIPTION varchar(64) DEFAULT NULL,
  BAR_RANGE_SQL varchar(2048) DEFAULT NULL,
  BAR_RANGE_LEGEND varchar(64) DEFAULT NULL,
  COMMENT varchar(128) DEFAULT NULL,
  PRIMARY KEY (GRAPH)
);


CREATE TABLE IF NOT EXISTS METRICSLA (
  APPLICATION varchar(32) NOT NULL DEFAULT '',
  METRIC_NAME varchar(128) NOT NULL DEFAULT '',
  METRIC_TXN_TYPE varchar(64) NOT NULL DEFAULT '',
  VALUE_DERIVATION varchar(64) NOT NULL DEFAULT '',
  SLA_MIN decimal(18,3) DEFAULT NULL,
  SLA_MAX decimal(18,3) DEFAULT NULL,
  IS_ACTIVE char(1) DEFAULT NULL,  
  COMMENT varchar(128) DEFAULT NULL,
  PRIMARY KEY (APPLICATION,METRIC_NAME,METRIC_TXN_TYPE,VALUE_DERIVATION)
);


CREATE TABLE IF NOT EXISTS RUNS (
  APPLICATION varchar(32) NOT NULL DEFAULT '',
  RUN_TIME char(12) NOT NULL DEFAULT '',
  IS_RUN_IGNORED varchar(1) DEFAULT NULL,
  RUN_REFERENCE varchar(128) DEFAULT NULL,
  PERIOD varchar(128) DEFAULT NULL,
  DURATION varchar(45) DEFAULT NULL,
  BASELINE_RUN char(1) DEFAULT NULL,
  COMMENT varchar(128) DEFAULT NULL,
  PRIMARY KEY (APPLICATION,RUN_TIME),
  UNIQUE KEY RUN (APPLICATION,RUN_TIME)
);


CREATE TABLE IF NOT EXISTS SLA (
  TXN_ID varchar(128) NOT NULL DEFAULT '',
  IS_CDP_TXN char(1) NOT NULL DEFAULT 'N',
  APPLICATION varchar(32) NOT NULL DEFAULT '',
  IS_TXN_IGNORED varchar(1) DEFAULT NULL,
  SLA_90TH_RESPONSE decimal(12,3) DEFAULT NULL,
  SLA_95TH_RESPONSE decimal(12,3) DEFAULT NULL,
  SLA_99TH_RESPONSE decimal(12,3) DEFAULT NULL,  
  SLA_PASS_COUNT bigint DEFAULT NULL,
  SLA_PASS_COUNT_VARIANCE_PERCENT decimal(12,3) DEFAULT NULL,
  SLA_FAIL_COUNT bigint DEFAULT NULL,
  SLA_FAIL_PERCENT decimal(12,3) DEFAULT NULL,
  TXN_DELAY decimal(18,3) NOT NULL DEFAULT '0.000',  
  XTRA_NUM decimal(18,3) NOT NULL DEFAULT '0.000',
  XTRA_INT bigint NOT NULL DEFAULT '0',
  SLA_REF_URL varchar(1024) DEFAULT NULL,
  COMMENT varchar(128) DEFAULT NULL,    
  PRIMARY KEY (TXN_ID,IS_CDP_TXN,APPLICATION)
);

 
CREATE TABLE IF NOT EXISTS TESTTRANSACTIONS (
  APPLICATION varchar(32) DEFAULT NULL,
  RUN_TIME char(12) DEFAULT NULL,
  TXN_ID varchar(128) DEFAULT NULL,
  TXN_TYPE varchar(32) DEFAULT NULL,
  IS_CDP_TXN char(1) NOT NULL DEFAULT 'N',    
  TXN_RESULT decimal(18,6) NOT NULL,
  TXN_PASSED varchar(4) DEFAULT NULL,
  TXN_EPOCH_TIME varchar(13) DEFAULT NULL
  -- INDEX (APPLICATION,RUN_TIME,TXN_ID,TXN_TYPE,IS_CDP_TXN)
  -- the index seemed to slow large datasets 
);
 

CREATE TABLE IF NOT EXISTS TRANSACTION (
  APPLICATION varchar(32) NOT NULL DEFAULT '',
  RUN_TIME char(12)  NOT NULL DEFAULT '',
  TXN_ID varchar(128)  NOT NULL DEFAULT '',
  TXN_TYPE varchar(32)  NOT NULL DEFAULT '',
  IS_CDP_TXN char(1) NOT NULL DEFAULT 'N',  
  TXN_MINIMUM decimal(18,3) NOT NULL,
  TXN_AVERAGE decimal(18,3) NOT NULL,
  TXN_MEDIAN decimal(18,3) NOT NULL,   
  TXN_MAXIMUM decimal(18,3) NOT NULL,
  TXN_STD_DEVIATION decimal(18,3) NOT NULL,
  TXN_90TH decimal(18,3) NOT NULL,
  TXN_95TH decimal(18,3) NOT NULL DEFAULT '-1.000',
  TXN_99TH decimal(18,3) NOT NULL DEFAULT '-1.000',  
  TXN_PASS bigint NOT NULL,
  TXN_FAIL bigint NOT NULL,
  TXN_STOP bigint NOT NULL,
  TXN_FIRST decimal(18,3) NOT NULL DEFAULT '-1.000',
  TXN_LAST decimal(18,3) NOT NULL DEFAULT '-1.000',
  TXN_SUM decimal(18,3) NOT NULL DEFAULT '-1.000',
  TXN_DELAY decimal(18,3) NOT NULL DEFAULT '0.000',  
  PRIMARY KEY (APPLICATION, RUN_TIME, TXN_ID, TXN_TYPE, IS_CDP_TXN)
);














